const LinkOptions = {
    "about": {
      key: "about",
      title: "About",
      subtext: "See more about me"
    },
    "development": {
      key: "development",
      title: "Development",
      subtext: "Check out what I have been developing"
    },
    "blog": {
      key: "blog",
      title: "Blog",
      subtext: "Check out what I have been developing"
    },
    "playground": {
        key: "playground",
        title: "Playground",
        subtext: "See work in progress projects"
    },
    "tunes": {
        key: "tunes",
        title: "Tunes",
        subtext: "listen to my playlist"
    }
  };


export default LinkOptions;
